#DROP SCHEMA awsDB_orig;

CREATE SCHEMA awsDB_orig;
use awsDB_orig;


CREATE TABLE `Countries` ( 
`CountryID` INT, 
`CountryName` VarChar(50), 
PRIMARY KEY (`CountryID`) 
); 

CREATE TABLE `Users` ( 
`UserID` Varchar(30) not null , 
`UserName` VarChar(50) not null, 
`Passcode` VarChar(30) not null, 
`CountryID` int,
`UserDOB` date,
FOREIGN KEY (`CountryID`) REFERENCES `Countries`(`CountryID`) 
ON DELETE CASCADE 
ON UPDATE CASCADE ,
PRIMARY KEY (`UserID`) 
); 



CREATE TABLE `Genres` ( 
`GenreID` INT, 
`Name` VarChar(30), 
PRIMARY KEY (`GenreID`) 
); 

CREATE TABLE `Actors` ( 
`ActorID` varchar(30), 
`ActorFirst` Varchar(50), 
`ActorLast` VarChar(50), 
`Age` INT, 
PRIMARY KEY (`ActorID`) 
);
 
CREATE TABLE `Director` ( 
`DirectorID` varchar(30), 
`firstName` VarChar(25), 
`lastName` Varchar(25), 
`ActorID` varchar(30) NULL, 
PRIMARY KEY (`DirectorID`)
); 

CREATE TABLE `Movies` ( 
`MovieID` varchar(30), 
`Runtime` INT,
`MovieName` Varchar(100), 
`releaseDate` DateTime, 
`CountryID` int, 
`Language` VARCHAR(40), 
`DirectorID` varchar(30), 
`Movie_Desc` VarChar(500), 
PRIMARY KEY (`MovieID`), 
FOREIGN KEY (`CountryID`) REFERENCES `Countries`(`CountryID`),
FOREIGN KEY (`DirectorID`) REFERENCES `Director`(`DirectorID`) 
ON DELETE CASCADE 
ON UPDATE CASCADE 
); 

CREATE TABLE `Movies_Users` ( 
`MovieID` varchar(30), 
`UserID` Varchar(30),
`NumberOfViews` int,
PRIMARY KEY (`MovieID`,`UserID`), 
FOREIGN KEY (`MovieID`) REFERENCES `Movies`(`MovieID`),
FOREIGN KEY (`UserID`) REFERENCES `Users`(`UserID`) 
ON DELETE CASCADE 
ON UPDATE CASCADE 
); 

CREATE TABLE `Cast` ( 
`ActorID` varchar(30), 
`MovieID` varchar(30), 
`ActorScreenName` Varchar(200), 
PRIMARY KEY (`ActorID`, `MovieID`), 
FOREIGN KEY(`ActorID`) REFERENCES `Actors`(`ActorID`) 
ON DELETE CASCADE 
ON UPDATE CASCADE, 
FOREIGN KEY(`MovieID`) REFERENCES `Movies`(`MovieID`) 
ON DELETE CASCADE 
ON UPDATE CASCADE 
); 

CREATE TABLE `Reviews` ( 
`ReviewID` INT, 
`UserID` varchar(30), 
`Rating` INT , 
`Review` text,
`MovieID` varchar(30),
PRIMARY KEY (`ReviewID`) ,
FOREIGN KEY (`UserID`) REFERENCES `Users`(`UserID`) 
ON DELETE CASCADE 
ON UPDATE CASCADE,
FOREIGN KEY (`MovieID`) REFERENCES `Movies`(`MovieID`) 
ON DELETE CASCADE 
ON UPDATE CASCADE 
); 

CREATE TABLE `GenreMovie` ( 
`MovieID` varchar(30), 
`GenreID` INT, 
`GenreName` VarChar(30), 
PRIMARY KEY (`MovieID`, `GenreID`), 
FOREIGN KEY (`MovieID`) REFERENCES `Movies`(`MovieID`) 
ON DELETE CASCADE 
ON UPDATE CASCADE, 
FOREIGN KEY (`GenreID`) REFERENCES `Genres`(`GenreID`)  
ON DELETE CASCADE 
ON UPDATE CASCADE
);











